import React from "react";
import { Box, Input, OutlinedInput, TextField } from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import logo from "/run/media/ij-singh/My Data/WEB DEVELOPMENT/Full Stack Projects/social-media-app/client/src/img/logo.png";

const LogoSearch = () => {
  return (
    <Box
      display={"flex"}
      sx={{
        position: "relative",
      }}
      alignItems={"center"}

    >
      <img src={logo} alt="logo" style={{
        padding: "0 10px"
      }} />
      <Box
        width={"100%"}
        m-marginX={1}
      >
        <OutlinedInput
          inputProps={{
            style: {
              padding: "10px",
              outline: "none",
              border: "0",
              width: "100%",
              height: "100%",
              borderRadius: "30px",
            },
          }}
          border={"0px"}
          margin="2"
          placeholder={'#Explore'}

        />
      </Box>
      <Box
        sx={{
          position: "absolute",
          right: "10px",
          background: "#fca61f",
          color: "#f3f3f3",
          padding: "5px",
          borderRadius: '5px',
          margin: "0 10px"
        }}
        // padding={2}
        color={"primary.main"}
        justifyContent={"center"}
        alignItems={"center"}
      >
        <SearchIcon
          fontSize="medium"
        />
      </Box>
    </Box>
  );
};

export default LogoSearch;
